import React, {Component, useState } from 'react';

// import CustomAlerts from './components/customAlerts';
import TableRow from '../tableRow';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faUserAlt, faUserAltSlash } from '@fortawesome/free-solid-svg-icons'; 
/**
 * @file module:src/components/table/index.jsx  
 * @param {number} props.index - Is the index of the line in the table
 * @returns the lines from the table, and in case of click 
 */


class CustomTable extends Component {
    constructor(props){ 
        super(props);

        console.log("PROPS:",props);
        console.log("NOMES",props.tableLines[0].headerName);

    };

    getuserdatas(){
        return (
          this.myUserList.map((user,i)=>
            {return ( 
              <TableRow
                key={"TableRowKey:",user.user_id}  
                index={i}  
                userData={this.myUserList}    
              > 
                <td >{user.user_first_name}</td> 
                <td>{user.user_birth_date}</td>
                <td>{user.user_gender}</td>
                <td>{ user.currentJob.user_job_title ?  user.currentJob.user_job_title : ''}</td>
                <td>{ user.currentJob.user_job_salary && user.currentJob.user_job_salary_currency_symbol ?  user.currentJob.user_job_salary_currency_symbol +' '+ user.currentJob.user_job_salary : ''}</td>
                <td>{ user.currentAddress.user_address_city ?  user.currentAddress.user_address_city : ''}</td>
                <td onClick={(event)=>event.stopPropagation()}><button name="Botao" onClick={()=>this.showModal(user.currentCar)} >Visualizar</button></td>
                <td style={{display:"flex",justifyContent: "center"}}>
                  {(i % 2 === 0) && (i % 4 === 0) ? 
                    <FontAwesomeIcon icon={faUserAlt} style={{fontSize:"25px",color:"#15a36f"}}/> 
                    : 
                    <FontAwesomeIcon icon={faUserAltSlash} style={{fontSize:"25px",color:"#a8140c"}}/>
                  }
                </td>
              </TableRow> 
            )}
          )
        )
      };

    getHeader() {
        console.log("PROPSAOOO",this.props);
        let headerTitles = this.props.tableLines;
        return(
            headerTitles.map((header, i) =>
            {return ( 
                <th>{headerTitles[i].headerName}</th>
            )})
        )
    }


    render(){
        return (
            <table style={{width: "100%",align:"center"}}>           
                <thead style={{backgroundColor: "#ff7070"}}>
                    <tr>
                        {this.getHeader()}
                    </tr>
                </thead>
            </table>
        )
    }
    
};

export default CustomTable;
